import React from "react";
import Carousel from 'nuka-carousel';
export const Slider: React.FC<ISlider> = props => (
    <Carousel width="250px" height="501px">{props.imgArray.map(img => <img src={img} alt="slide"/>)}</Carousel>
);

interface ISlider {
    imgArray: string[];
}
